import React, { useState } from 'react';
import {List, Button} from 'antd';
import {Container} from './style';

export default function Relatorio({RA, setLeitura}){

    const data = [
        {pergunta: 'Qual seu nome?',
        resposta: 'Vinicius'
        }
    ];

    return(
        <Container>
            <Button onClick={()=>setLeitura(true)}>Voltar</Button>
            <List
                itemLayout="horizontal"
                dataSource={data}
                renderItem={item => (
                <List.Item>
                    <List.Item.Meta
                    title={<h3>{item.pergunta}</h3>}
                    description={item.resposta}
                    />
                </List.Item>
                )}
            />
        </Container>
    );
}
